// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./IPancakeRouter02.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./IToken.sol";
import "@uniswap/lib/contracts/libraries/TransferHelper.sol";

contract NFTPortfolio {
    address internal constant pancakeSwapAddress =
        0x10ED43C718714eb63d5aA57B78B54704E256024E; //Router for pancake bsc mainnet

    IPancakeRouter02 public pancakeSwapRouter;

    address private vault = 0x6056773C28c258425Cf9BC8Ba5f86B8031863164;

    IToken public nftToken;

    using SafeMath for uint256;

    address private crypto11 = 0x715D400F88C167884bbCc41C5FeA407ed4D2f8A0; // AXS
    address private crypto12 = 0x12BB890508c125661E03b09EC06E404bc9289040; // RACA
    address private crypto13 = 0x3203c9E46cA618C8C1cE5dC67e7e9D75f5da2377; // MBOX
    address private crypto14 = 0x949D48EcA67b17269629c7194F4b727d4Ef9E5d6; // MC
    address private crypto15 = 0xAC51066d7bEC65Dc4589368da368b212745d63E8; // ALICE

    mapping(address => uint256) public axsBalance;
    mapping(address => uint256) public racaBalance;
    mapping(address => uint256) public mboxBalance;
    mapping(address => uint256) public mcBalance;
    mapping(address => uint256) public aliceBalance;

    struct rate {
        uint256 numerator;
        uint256 denominator;
    }
    mapping(address => uint256) admins;
    rate public currentRate;

    constructor() {
        pancakeSwapRouter = IPancakeRouter02(pancakeSwapAddress);
        nftToken = IToken(0x16dBB234A9a595967DdC2ea1bb53379752f09Ad4);
    }

    function updateRate(uint256 _numerator, uint256 _denominator) public {
        require(_numerator != 0);
        require(_denominator != 0);
        currentRate.numerator = _numerator;
        currentRate.denominator = _denominator;
    }

    function setUpDataNFT(
        uint256 axs,
        uint256 race,
        uint256 mbox,
        uint256 mc,
        uint256 alice,
        address user
    ) public {
        axsBalance[user] = axsBalance[user] + axs;
        racaBalance[user] = racaBalance[user] + race;
        mboxBalance[user] = mboxBalance[user] + mbox;
        mcBalance[user] = mcBalance[user] + mc;
        aliceBalance[user] = aliceBalance[user] + alice;
    }

    function investInFundNFT() public payable {
        // approve
        nftToken.approve(address(this), msg.value);

        // update rate
        updateRate(100, 100);

        uint256[] memory crpyto1Amount;
        uint256[] memory crpyto2Amount;
        uint256[] memory crpyto3Amount;
        uint256[] memory crpyto4Amount;
        uint256[] memory crpyto5Amount;

        uint256 deadline = block.timestamp + 15; // using now for convenience, for mainnet pass deadline from frontend!

        crpyto1Amount = pancakeSwapRouter.swapExactETHForTokens{
            value: msg.value / 5
        }(0, getPathForETH(crypto11), vault, deadline);

        crpyto2Amount = pancakeSwapRouter.swapExactETHForTokens{
            value: msg.value / 5
        }(0, getPathForETH(crypto12), vault, deadline);

        crpyto3Amount = pancakeSwapRouter.swapExactETHForTokens{
            value: msg.value / 5
        }(0, getPathForETH(crypto13), vault, deadline);

        crpyto4Amount = pancakeSwapRouter.swapExactETHForTokens{
            value: msg.value / 5
        }(0, getPathForETH(crypto14), vault, deadline);

        crpyto5Amount = pancakeSwapRouter.swapExactETHForTokens{
            value: msg.value / 5
        }(0, getPathForETH(crypto15), vault, deadline);

        setUpDataNFT(
            crpyto1Amount[1],
            crpyto2Amount[1],
            crpyto3Amount[1],
            crpyto4Amount[1],
            crpyto5Amount[1],
            msg.sender
        );
        uint256 cryptoAmount = msg.value;
        uint256 tokenAmount = cryptoAmount.mul(currentRate.numerator).div(
            currentRate.denominator
        );
        nftToken.mint(msg.sender, tokenAmount);
        // refund leftover ETH to user
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "refund failed");
    }

    function withdrawFromFundNFT(uint256 tokenAmount) public payable {
        uint256 amount1 = axsBalance[msg.sender];
        uint256 amount2 = racaBalance[msg.sender];
        uint256 amount3 = mboxBalance[msg.sender];
        uint256 amount4 = mcBalance[msg.sender];
        uint256 amount5 = aliceBalance[msg.sender];

        // IDT Token Burn
        TransferHelper.safeTransferFrom(
            address(nftToken),
            msg.sender,
            address(this),
            tokenAmount
        );
        TransferHelper.safeApprove(
            address(nftToken),
            address(this),
            tokenAmount
        );

        nftToken.burn(address(this), tokenAmount);
        // -------------------------------------------------------------------------------------------- //

        //Getting Investment Back From Vault to Contract
        TransferHelper.safeTransferFrom(
            address(crypto11),
            vault,
            address(this),
            amount1
        );
        TransferHelper.safeApprove(
            address(crypto11),
            address(pancakeSwapRouter),
            amount1
        );

        TransferHelper.safeTransferFrom(
            address(crypto12),
            vault,
            address(this),
            amount2
        );
        TransferHelper.safeApprove(
            address(crypto12),
            address(pancakeSwapRouter),
            amount2
        );

        TransferHelper.safeTransferFrom(
            address(crypto13),
            vault,
            address(this),
            amount3
        );
        TransferHelper.safeApprove(
            address(crypto13),
            address(pancakeSwapRouter),
            amount3
        );

        TransferHelper.safeTransferFrom(
            address(crypto14),
            vault,
            address(this),
            amount4
        );
        TransferHelper.safeApprove(
            address(crypto14),
            address(pancakeSwapRouter),
            amount4
        );

        TransferHelper.safeTransferFrom(
            address(crypto15),
            vault,
            address(this),
            amount5
        );
        TransferHelper.safeApprove(
            address(crypto15),
            address(pancakeSwapRouter),
            amount5
        );

        // ------------------------------------------------------------------------------------------------ //

        // Converting back to BNB
        uint256 deadline = block.timestamp + 15;

        pancakeSwapRouter.swapExactTokensForETH(
            amount1,
            0,
            getPathForToken(crypto11),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactTokensForETH(
            amount2,
            0,
            getPathForToken(crypto12),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactTokensForETH(
            amount3,
            0,
            getPathForToken(crypto13),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactTokensForETH(
            amount4,
            0,
            getPathForToken(crypto14),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactTokensForETH(
            amount5,
            0,
            getPathForToken(crypto15),
            msg.sender,
            deadline
        );
    }

